import '../style/Header.css'

function Contact() {
    return (
        <div>
            <h1>Contact</h1>
            <div
            //  style={{display: 'flex'}}
             >
                <div>
                    <h2>We are here for eveyr part of the process. Schedule a one on one session with us.</h2>
                    <a>
                        <button>Schedule a Meeting</button>
                    </a>
                </div>
                <div>
                    <h4>If you just have a question or need to reach us. You can email us at <br/><a href="mailto: info@mora-designs.com" style={{ textDecoration: 'none'}}>info@mora-designs.com</a></h4>
                </div>
            </div>
        </div>
    )
}

export default Contact;
